#include "system/text.h"

#include "rohan.h"

void mt_render_text_2d(rohan_shader_object *shader, int width, mt_string_view text, int x, int y, int w, int h)
{
    float vertices[] = {x, y, 0.f, 0.f, x + w, y, 1.f, 0.f, x + w, y + h, 1.f, 1.f, x, y + h, 0.f, 1.f};
    int indices[] = {0, 1, 2, 3};
    rohan_render(shader, width, vertices, indices, 4, ROHAN_QUAD);
}

